import React from "react";

export default function App() {
  return (
    <>
      <div id="backimg">
        <div id="navdiv">
          <div className="flexnav">Services</div>
          <div className="flexnav">About</div>
          <div className="flexnav">Contect</div>
          <div className="flexnav">Home</div>
          <p>Save EARTH</p>
          <p>Save LIFE</p>
        </div>
      </div>
    </>
  );
}
